import {shippingAction} from '../ShipReducer'




export const addShipping =({address,city,phoneNumber,postalCode,Country}) =>{
    return dispatch =>{
        dispatch(shippingAction.AddShipping(address,city,phoneNumber,postalCode,Country))
    }
}
